import React from 'react';

const Footer = () => {
    return (
        <div className="myfooter">
            <footer className="align-middle">
                <p className='text-center align-middle m-2' style={{fontFamily: 'Neucha',}}>Made with ❤ by Agnibesh © 2020</p>
            </footer>
        </div>
    );
};

export default Footer;
